import React from 'react';
import ReactDOM from 'react-dom';
import MainComponent from './MainComponent';
import './styles/DataTable.css';  // Import DataTable styles
import './styles/ScatterPlot.css';  // Import ScatterPlot styles

ReactDOM.render(
  <React.StrictMode>
    <MainComponent />
  </React.StrictMode>,
  document.getElementById('root')
);
